import BrainFlixlogo from "./Assets/Logo/BrainFlix-logo.svg";
import searchIcon from "./Assets/Icons/search.svg";
// import appStyle from "./styles/App.scss";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <a href="">
          <img
            src={require("./Assets/Logo/BrainFlix-logo.svg").default}
            alt={"BrainFlix"}
          />
        </a>
        <form>
          <label for="search">
            <input type="text" placeholder={searchIcon} />
            <button>
              <img
                className="App-header__search-input"
                src={require("./Assets/Icons/upload.svg").default}
                alt="search icon"
              />
              UPLOAD
            </button>
          </label>
        </form>
        <img
          src={require("./Assets/Images/Mohan-muruge.jpg")}
          alt="Login Avatar"
        />
      </header>
    </div>
  );
}

export default App;
